const mongoose = require('mongoose');
const customEnv = require('custom-env');
customEnv.env(process.env.NODE_ENV, './config');

const userService = require('../services/users');
const postService = require('../services/posts');

const NAMES = ['Liam', 'Noah', 'Oliver', 'James', 'Elijah', 'William', 'Henry', 'Lucas', 'Benjamin', 'Theodore'];
const PFPS = [
    'data:image/png;base64,',
    'data:image/png;base64,',
    'data:image/png;base64,',
]

const PICTURES = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
]
const POST_AMOUNT = 3;

(async () => {
    // connect to database
    const connection = await mongoose.connect(process.env.MONGO_URL);
    console.log(`Successfully connected to MongoDB at ${process.env.MONGO_URL}`);

    // populate database
    for (const name of NAMES) {
        const username = name.toLowerCase();
        const password = username.split('').reverse().join('');
        const pfp = PFPS[Math.floor(Math.random() * (PFPS.length))];

        // create user
        const user = await userService.createUser(name, username, password, pfp);

        for (let index = 0; index < POST_AMOUNT; index++) {
            const likes = Math.floor(Math.random() * 20);

            const picture = PICTURES[Math.floor(Math.random() * (PICTURES.length))];
            // populate user posts
            await postService.createPost(
                `This is a test post number ${index} from ${name}`,
                picture,
                user._id.toString(),
                Date.now(),
                pfp,
                name,
                likes    
            );
        }
        
        console.log(`User created with ${POST_AMOUNT} posts. Username: ${username}. Password: ${password}`);
    }

    console.log(`Disconnecting from MongoDB...`)
    await connection.disconnect();
})();